layer.description:
The Mayor's Order 2017-115 establishes a comprehensive data policy for the District government. The data created and managed by the District government are valuable assets and are independent of the information systems in which the data reside. As such, the District government shall:
Maintain an inventory of its enterprise datasets;
Classify enterprise datasets by level of sensitivity;
Regularly publish the inventory, including the classifications, as an open dataset; and
Strategically plan and manage its investment in data.
The greatest value from the District’s investment in data can only be realized when enterprise datasets are freely shared among District agencies, with federal and regional governments, and with the public to the fullest extent consistent with safety, privacy, and security. For more information, please visit Data Policy.

